import './App.css';
import Shopitem from './components/Shopitem';
import Header from './components/Header'
import {BrowserRouter,Switch,Route} from 'react-router-dom'
import Cart from './components/Cart'
function App() {
  return (
    <div>
      <BrowserRouter>
      <Header />
      <Switch>
        <Cart />
      <Shopitem />
      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
